{
    "parserOptions": {
        "ecmaVersion": 8,
        "sourceType": "module",
        "ecmaFeatures": {
            "jsx": false
        }
    },
    "rules": {
        "semi": "error",
        "quotes": ["error", "single"]
    },
    "env": {
        "es6": true
    }
}

{
    "singleQuote": true,
    "arrowParens": "avoid"
}

{
    "JavaScript": {
        "indent_size": 4,
        "indent_char": " ",
        "quotes": "single"
    },
    "TypeScript": {
        "indent_size": 4,
        "indent_char": " ",
        "quotes": "single"
    }
}

/**
 * Karma configuration file.
 *
 * @see https://karma-runner.github.io/0.13/config/configuration-file.html
 */
import * as path from 'path';

const ROOT = path.resolve(__dirname, '.');

function rootPath() {
    return path.join.apply(
        path, [ROOT].concat(Array.prototype.slice.call(arguments, 0))
    );
}

export default function (config) {
    config.set({

        basePath: '',

        frameworks: ['mocha', 'karma-typescript', 'chai', 'sinon'],

        files: ['src/**/*.ts'],

        preprocessors: {
            '**/*.ts': ['karma-typescript']
        },

        plugins: [
            require('karma-coverage'),
            require('karma-mocha'),
            require('karma-chai'),
            require('karma-sinon'),
            require('karma-remap-coverage'),
            require('karma-typescript'),
            require('karma-typescript-preprocessor'),
        ],

        client: {
            clearContext: false // leave Jasmine Spec Runner output visible in browser
        },

        /**
         * add both "karma-coverage" and "karma-remap-coverage" reporters
         */
        reporters: ['progress', 'coverage', 'remap-coverage', 'dots', 'karma-typescript'],

        /**
         * save interim raw coverage report in memory
         */
        coverageReporter: {
            type: 'in-memory'
        },

        /**
         * define where to save final remaped coverage reports
         */
        remapCoverageReporter: {
            'text-summary': null,
            html: './coverage/html',
            cobertura: './coverage/cobertura.xml'
        },

        /**
         * Port to listen in browser.
         */
        port: 9876,

        /**
         * Cool colors in CLI
         */
        colors: true,

        /**
         * Wath kinda logs should be shown
         */
        logLevel: config.LOG_INFO,

        /**
         * Watch for code modifications
         */
        autoWatch: true,

        /**
         * What browsers should be used
         */
        browsers: ['Chrome_headless'],

        customLaunchers: {
            Chrome_headless: {
                base: 'Chrome',
                flags: [
                    ' ‚Äî headless',
                    ' ‚Äî disable-gpu',
                    ' ‚Äî remote-debugging-port=9222'
                ]
            }
        },

        /**
         * Keep testing or not.
         */
        singleRun: false,

        concurrency: Infinity
    });
};

import resolve from '@rollup/plugin-node-resolve';

export default {
  input: 'dist/es2015/index.js',
  external: [
    '@zxing/text-encoding',
  ],
  plugins: [
    resolve(),
  ],
  context: '(globalThis || global || self || window || undefined)',
  output: {
    format: 'umd',
    name: 'ZXing',
    sourcemap: true,
    file: 'dist/umd/index.js'
  },
};

{
  "compilerOptions": {
    "baseUrl": "./",
    "module": "commonjs",
    "target": "es5",
    "moduleResolution": "node",
    "lib": [
      "es7",
      "dom"
    ],
    "alwaysStrict": true,
    "noImplicitAny": false,
    "sourceMap": true,
    "declaration": true,
    "preserveConstEnums": true,
    "downlevelIteration": true,
    "paths": {
      "@zxing/library": [
        "./dist"
      ],
      "@zxing/library/*": [
        "./dist/*"
      ]
    }
  },
  "include": [
    "src/**/*.ts"
  ]
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "module": "commonjs",
    "target": "es5",
    "outDir": "dist/cjs",
    "sourceMap": false
  },
  "exclude": [
    "src/test"
  ]
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "module": "es2015",
    "target": "es2015",
    "outDir": "dist/es2015",
    "sourceMap": false
  },
  "exclude": [
    "src/test"
  ]
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "module": "es2015",
    "target": "es5",
    "outDir": "dist/esm",
    "sourceMap": false
  },
  "exclude": [
    "src/test"
  ]
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "module": "esnext",
    "target": "esnext",
    "outDir": "dist/esnext",
    "sourceMap": false
  },
  "exclude": [
    "src/test"
  ]
}

{
  "extends": "./tsconfig.json",
  "compilerOptions": {
    "target": "es6",
    "module": "commonjs",
    "moduleResolution": "node",
    "lib": [
      "es7",
      "dom"
    ],
    "outDir": "output/tests"
  },
  "include": [
    "src/test/**/*.ts"
  ],
  "exclude": [
    "node_modules",
    "src/core"
  ]
}
